```json
{
  "application": "COBALT",
  "details": {
    "environment": {
      "MPICH_MPIIO_HINTS": "*:romio_cb_read=enable:romio_cb_write=enable",
      "BGLOCKLESSMPIO_F_TYPE": "0x47504653",
      "DARSHAN_TOKIO_LOG_PATH": "${TOKIO_JOB_DIR}/runs/darshan-logs"
    },
    "resources": {
      "nodes": 1024,
      "time": 60,
      "mode": "script"
    },
    "libraries": {
      "IOR": "v2.1.0 or later",
      "HACC-IO": "v2.1.0 or later",
      "VPIC-IO": "v2.1.0 or later",
      "Darshan": "v2.1.0 or later"
    },
    "input_file": "${TOKIO_INPUTS_DIR}/mira.params",
    "output_dir": "${TOKIO_OUT_DIR}"
  }
}
```

This script runs within the **COBALT** workload manager environment. It utilizes various libraries like **IOR**, **HACC-IO**, and **VPIC-IO**, along with **Darshan** for performance analysis. The script defines functions for running these benchmarks, setting up and cleaning up the environment. It also utilizes environment variables for configuring the runtime environment and input/output directories.
